export default function Blog() {
    let data = [
        {
            title: "Blog Post 1",
            body: "This is my first blog post!"
        },
        {
            title: "Blog Post 2",
            body: "This is my second blog post!"
        },
        {
            title: "Blog Post 3",
            body: "This is my third blog post!"
        }
    ]
    return (
        <div>
            <h1>Blog</h1>
            <p>Welcome to my blog!</p>
        </div>
    )
}
